import React from "react";
import { Text, StyleSheet, View} from "react-native";



const BoxScreen = () => {
        

    return( 
    <View styles = {styles.viewStyle}>
        <Text styles = {styles.textStyle}>Boxs screen</Text>
    </View>
    
    );


};

const styles = StyleSheet.create({

    viewStyle: {

        borderWidth: 10,
        borderColor: 'black',
        margin: 100

    },

    textStyle: {

        
        borderWidth: 10,
        borderColor: 'red',
        margin: 20
    }



}) ;


export default BoxScreen;
